import React, { useState, useEffect } from 'react';
import Calendar from 'react-calendar'; // For the calendar
import 'react-calendar/dist/Calendar.css'; // Default styling
import './Styling/dashboardStyle.css'; // Custom styling
import  supabase  from './supabaseClient'; // Import your Supabase client

const Dashboard = () => {
    const [date, setDate] = useState(new Date());
    const [availableTimes, setAvailableTimes] = useState([]);
    const [selectedTime, setSelectedTime] = useState('');
    const [service, setService] = useState('');
    const [userName, setUserName] = useState('');
    const [userEmail, setUserEmail] = useState('');
    const [userPhone, setUserPhone] = useState('');
    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');

    // Handle date change
    const handleDateChange = (newDate) => {
        setDate(newDate);
        fetchAvailableTimes(newDate);
    };

    // Fetch available times from Supabase
    const fetchAvailableTimes = async (selectedDate) => {
        const formattedDate = selectedDate.toISOString().split('T')[0];
        const { data, error } = await supabase
            .from('available_times')
            .select('time')
            .eq('date', formattedDate);

        if (error) {
            console.error('Error fetching available times:', error.message);
        } else {
            setAvailableTimes(data || []);
        }
    };

    // Handle time selection
    const handleTimeClick = (time) => {
        setSelectedTime(time);
    };

    // Handle booking submission
    const handleBooking = async (e) => {
        e.preventDefault();
        if (!selectedTime || !service || !userName || !userEmail || !userPhone) {
            setError('Please fill out all fields.');
            return;
        }

        const formattedDate = date.toISOString().split('T')[0];
        const { data, error } = await supabase
            .from('bookings')
            .insert([
                {
                    date: formattedDate,
                    time: selectedTime,
                    service,
                    user_name: userName,
                    user_email: userEmail,
                    user_phone: userPhone,
                },
            ]);

        if (error) {
            console.error('Error creating booking:', error.message);
            setError('Failed to create booking.');
        } else {
            setSuccess('Booking created successfully!');
            setError('');
            // Optionally clear the form or redirect the user
            setSelectedTime('');
            setService('');
            setUserName('');
            setUserEmail('');
            setUserPhone('');
        }
    };

    useEffect(() => {
        fetchAvailableTimes(date); // Fetch available times for initial date
    }, [date]);

    return (
        <div className="dashboard">
            <Calendar
                onChange={handleDateChange}
                value={date}
                className="calendar"
            />
            <div className="available-times">
                <h2>Available Times for {date.toDateString()}</h2>
                <ul>
                    {availableTimes.length > 0 ? (
                        availableTimes.map((time, index) => (
                            <li
                                key={index}
                                onClick={() => handleTimeClick(time.time)}
                                className={`time-slot ${selectedTime === time.time ? 'selected' : ''}`}
                            >
                                {time.time}
                            </li>
                        ))
                    ) : (
                        <li>No available times</li>
                    )}
                </ul>
            </div>
            {selectedTime && (
                <form onSubmit={handleBooking} className="booking-form">
                    <h2>Create Booking</h2>
                    {error && <p className="error-message">{error}</p>}
                    {success && <p className="success-message">{success}</p>}
                    <div className="form-group">
                        <label>Service:</label>
                        <input
                            type="text"
                            value={service}
                            onChange={(e) => setService(e.target.value)}
                        />
                    </div>
                    <div className="form-group">
                        <label>Your Name:</label>
                        <input
                            type="text"
                            value={userName}
                            onChange={(e) => setUserName(e.target.value)}
                        />
                    </div>
                    <div className="form-group">
                        <label>Your Email:</label>
                        <input
                            type="email"
                            value={userEmail}
                            onChange={(e) => setUserEmail(e.target.value)}
                        />
                    </div>
                    <div className="form-group">
                        <label>Your Phone:</label>
                        <input
                            type="text"
                            value={userPhone}
                            onChange={(e) => setUserPhone(e.target.value)}
                        />
                    </div>
                    <button type="submit">Book Now</button>
                </form>
            )}
        </div>
    );
};

export default Dashboard;
